import React, { Component } from 'react';
import { number } from 'prop-types';

class Timer extends Component {
  render() {
    const { timer } = this.props;
    return (
      <div
        className="timer-container"
      >
        <p>
          { timer }
        </p>
      </div>
    );
  }
}

Timer.propTypes = {
  timer: number.isRequired,
};

export default Timer;
